(1, 'offer-request', NULL, 'Offer Request', 'Offer Request', '<!-- ======= Contact Section ======= -->\r\n        <section class=\"contact\" data-aos=\"fade-up\" data-aos-easing=\"ease-in-out\" data-aos-duration=\"500\">\r\n            <p class=\"container\">\r\n                <p class=\"row\">\r\n                    <div class=\"col-lg-12\">\r\n                        \r\n                            <div class=\"form-row\">\r\n                                <div class=\"col-md-6 form-group\">Have we spiked your interest? That makes us happy. Send us your enquiry here and leave us a telephone number or email address as to how we can best reach you. This way we will collect all the necessary information for a quotation from you and then convince you of our services with an exciting offer.<br>\r\n                                    </div><div class=\"col-md-6 form-group\"><input type=\"text\" name=\"name\" class=\"form-control\" id=\"name\" placeholder=\"Your Name\" data-rule=\"minlen:4\" data-msg=\"Please enter at least 4 chars\">\r\n                                    <div class=\"validate\"></div>\r\n                                </div>\r\n                                <div class=\"col-md-6 form-group\">\r\n                                    <input type=\"email\" class=\"form-control\" name=\"email\" id=\"email\" placeholder=\"Your Email\" data-rule=\"email\" data-msg=\"Please enter a valid email\">\r\n                                    <div class=\"validate\"></div>\r\n                                </div>\r\n                            </div>\r\n                            <div class=\"form-group\">\r\n                                <input type=\"text\" class=\"form-control\" name=\"subject\" id=\"subject\" placeholder=\"Subject\" data-rule=\"minlen:4\" data-msg=\"Please enter at least 8 chars of subject\">\r\n                                <div class=\"validate\"></div>\r\n                            </div>\r\n                            <div class=\"