(10, 'become-a-partner', 6, 'Become a partner', 'Become a partner', '<h2>Schnell. Intuitiv. Zuverl&auml;ssig.</h2>\r\n<p>&nbsp;</p>\r\n<p>Durch Momentaa erhalten Kurier- und Logistikunternehmen Zugang zu spannenden Auftr&auml;gen in ihrem individuellen Liefergebiet. Unsere Plattform verbindet professionelle und verl&auml;ssliche Paket-, Express- und Fahrradkuriere in Hannover mit Lieferjobs aus Einzelhandel, Gastronomie und E-Commerce. Alles auf einer digitalen und intuitiv bedienbaren Plattform. Durch die Zusammenarbeit mit Momentaa kommen Sie an viele weitere Kurierfahrer-Jobs und k&ouml;nnen gleichzeitig Leerfahrten minimieren. Wir helfen Ihnen, effiziente Routen f&uuml;r Ihre Lieferungen zu finden. Dadurch optimieren Sie ihre Ressourcen und sparen Zeit und Kosten. ----- Fast. Intuitive. Reliable. Through Momentaa, courier and logistics companies gain access to exciting jobs in their individual delivery area. Our platform connects professional and reliable parcel, express and bike couriers in Hannover with delivery jobs from retail, gastronomy and e-commerce. All on one digital and intuitive platform. By working with Momentaa, you can access many more courier driver jobs while minimizing empty runs. We help you find efficient routes for your deliveries. As a result, you optimize your resources and save time and money.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<form id=\"myFrom\" action=\"#\" method=\"post\">\r\n<div class=\"form-row\">\r\n<div class=\"col-md-12 form-group\">\r\n<div class=\"input-group mb-3\">\r\n<div class=\"input-group-prepend\"><select id=\"inputGroupSelect04\" class=\"custom-select\">\r\n<option value=\"1\">Mr</option>\r\n<option value=\"2\">Mis</option>\r\n</select></div>\r\n<input class=\"form-control\" name=\"name\" type=\"text\" placeholder=\"First name/ Last name\" /></div>\r\n</div>\r\n<div class=\"col-md-6 form-group\"><input class=\"form-control\" name=\"email\" type=\"email\" placeholder=\"Your Email\" /></div>\r\n<div class=\"col-md-6 form-group\"><input class=\"form-control\" name=\"phone\" type=\"text\" placeholder=\"Telephone\" /></div>\r\n<div class=\"col-md-12 form-group\"><textarea class=\"form-control\" name=\"message\" rows=\"6\" placeholder=\"Message\"></textarea></div>\r\n</div>\r\n<div class=\"text-center\"><button class=\"btn btn-info btn-block\" type=\"submit\">Send Message</button></div>\r\n</form>', NULL, NULL, '2021-05-17 22:20:17', '2021-08-21 19:17:09');
