(11, 'moving-shop', NULL, 'Moving shop', 'Moving shop', '<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"cold-md-4\"><img title=\"bubble1.jpeg\" src=\"data:image/jpeg;base64,\" alt=\"\" width=\"300\" height=\"200\" /> <br />\r\n<p>Bubblewrap, 0.30 pro Meter</p>\r\n</div>\r\n<div class=\"cold-md-4\"><img title=\"material1.jpeg\" src=\"data:image/jpeg;base64,\" alt=\"\" width=\"300\" height=\"204\" /> <br />\r\n<p>Styropor, 1.00 pro Kubikmeter</p>\r\n</div>\r\n<div class=\"cold-md-4\"><img title=\"box1.webp\" src=\"data:image/webp;base64,\" alt=\"\" width=\"300\" height=\"225\" /> <br />\r\n<p>Umzugskartons, 0.80 pro St&uuml;ck</p>\r\n</div>\r\n<div class=\"col-md-12\">In our moving shop you will find everything you need in terms of packing materials for your move. We attach great importance to using reusable materials. Of course, we do not discourage you from using already used moving boxes, etc. In order to be able to use our material as long as possible, we rely on moving boxes made of recycled plastic, which we provide for your move on a rental basis. Of course, we also offer new moving boxes if this is desired.</div>\r\n</div>\r\n</div>', NULL, NULL, '2021-05-18 01:17:01', '2021-08-07 23:27:09');
INSERT INTO `pages` (`id`, `slug`, `parent_id`, `title`, `description`, `content`, `icon`, `image`, `created_at`, `updated_at`) VALUES
(12, 'app', NULL, 'App', 'App', '<p style=\"text-align: center;\"><img title=\"female.png\" src=\"data:image/png;base64,\" alt=\"\" width=\"474\" height=\"474\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>A simple transport from A to B can also be booked in our brand new Momentaa-App.</p>\r\n<p>For a booking in the app we only need a few essential infos such as size and weight of the good to be transported, and the pick-up and delivery coordinates. With this information we scan our driver-network&nbsp; for the perfect vehicle&nbsp; to the desired pick-up and delivery location. The price is calculated immediately and you can pay by credit card or when the driver comes to pick up your goods. Our app is available in the Google Play Store or in the App Store. Download it today! *We reserve the right to adjust prices if transport information varies from the effective transport.</p>\r\n<p>\"Google Play Button - Download here\"</p>\r\n<p>\"App Store Button - Download here\"</p>', NULL, NULL, '2021-05-18 01:17:10', '2021-07-08 20:40:35'),
(13, 'same-day-delivery', 12, 'Same day delivery', 'Same day delivery', '<p><span style=\"color: #000000; font-family: monospace; font-size: medium; font-style: normal; font-weight: 400; white-space: pre;\">The last mile</span></p>', NULL, NULL, '2021-05-18 01:17:19', '2021-07-12 22:34:57'),
(14, 'sustainability', NULL, 'Sustainability', 'Sustainability', '<h3>We have founded Momentaa with a very important thought: to keep our services sustainable and clean. </h3>\r\n<p>We compensate CO2 by protecting the rain forest, we offer fair labour conditions and pay fair wages. All the equipment we use for your services is either sourced sustainably or is being reused. Our aim is to finally make logistics and moving green. By planning routes efficiently, by knowing our customers requirements and knowing everything about the goods we will transport for you, we can also set focus on the most efficient way and to compensate accordingly. We are not just another moving company, we are the first green and sustainable logistics and transport company of Hannover and we\'re proud of it.</p>\r\n<h3 class=\"title\">Sustainable logistics explained</h3>\r\n<p class=\"description\"><em>You probably wonder, how logistics can be sustainable? Let us explain.</em></p>\r\n<p>Momentaa\'s idea of sustainable logistics is pretty easy. We act as green as we possibly can. Now you wonder how we can do this. It\'s simple:&nbsp;for any of our services we choose the most efficient and sustainable way. The vehicles we use are preferably electric, human-powered (bicylces for short distances), and we re-use our packaging materials that are needed for moves. We use enhanced route-planning methods so we can save as much CO2 as possible.&nbsp;Any emmission that is still being produced is being compensated by protecting the rain forrest.</p>\r\n<h3>Our promise to you and the environment</h3>\r\n<p class=\"font-italic\">We know that logistics can be green. And this is why we\'re here.</p>\r\n<p>We\'re here to convince you from the fact that logistics can also be green and sustainable. This does not only mean that we take care of our environmental footprint, but also that the labour conditions at Momentaa are fair and we take good care of our employees. In fact, this promise is the reason why we exist. We have seen the contrary and are here to strive for the best. We are here to convince others from our ways and our methods.</p>\r\n<p>Frankly, logistics is not a chapter today\'s economy can be proud of and this is what we want to change. Any CO2 that&nbsp;is being generated&nbsp;from what we do is being compensated or prevented: by preferring e-vehicles or bicycles before anything else, we make a first step.&nbsp;By compensation we mean our very valuable cooperation with&nbsp;Forest Finance. Now, do you start believing, too?</p>', NULL, NULL, '2021-05-18 01:17:27', '2021-07-21 23:54:13'),
(15, 'who-we-are', NULL, 'Who we are?', 'The heads behind the idea.', '<p>Logistics is everywhere. Have you ever thought of the pineapple, the sofa, your dishes, basicallly anything you are using in your daily life? All of it came to the place where you have bought it with some mean of transportation. We are fascinated by that. But also pretty scared, because logistics is causing such a big part of global carbon dioxyde emissions: 25% of all emissions are caused by transports. Imagine that. And this is, where our founder, Nael Arafat, comes into play.</p>\r\n<p>Nael has been travelling the world for nearly 34 years - with any means you can possibly imagine. Now living in Hannover and with a head full of thoughts on how to make the world a better place, the idea for Momentaa was born.</p>\r\n<p>With his great network of friends and companies, Nael has set up the company to be international, sustainable and efficient. Most important: with the smallest negative effect on the environment possible. By making house moving, transports and logistics green, his mission is heroic. If other companies look at our small start up, we can make a change.</p>\r\n<p>Be part of the change. Switch to green logistics.</p>', NULL, NULL, '2021-05-18 01:17:50', '2021-07-22 00:03:27'),
